import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Comment, Avatar, Form, Button, List, Input, Tag, Row, Col } from 'antd';
import Card from '../Components/Card'
import moment from 'moment';
import "antd/dist/antd.css";
import "./index.css";


const App: React.FC = () => {
  return (
    <div className="App">
        <Row>
          <Col span={6}>col-6</Col>
          <Col span={18}>
            <header style={{background:"red", height: 64}}>

            </header>
            <a>Avantages</a>
            <h1>Subvention Sports</h1>
            <Button type="primary">Éditer</Button>
            <img src="http://placehold.it/128x128"/>
            <Tag color="magenta">Subvention</Tag>
            <p>Inscriptions: 01/01/2019 - 27/12/2019</p>
            <p>165 jours restants avant la fermeture</p>
            <p>Remboursement des activités sportives des salariés à hauteur de 150€ sur présentation de factures nominatives de licence sportive, d’adhésion à un club de sport ou d'achat de billetterie pour des événements sportifs.</p>
            <div>
              <h3>Commentaires</h3>
              <Button type="primary">Éditer</Button>
            </div>
          </Col>
        </Row>
    </div>
  );
}

export default App;
